                "description": "One of the finest residences in Manhattan, this prewar apartment building was built by John D. Rockefeller in 1929 as a retreat for his friends and family. It is centrally located in Beekman Place, a coveted oasis easily accessible yet offering supreme privacy. This mint condition four bedroom duplex maisonette features its own grand private entrance as well as one through the attended lobby. It offers the unique opportunity to enjoy townhouse living with all the amenities of coop ownership. A magnificent riverfront terrace off the living room and library overlooks private gardens and the East River. Special features include a beautiful formal dining room, huge kitchen with breakfast room, 3 fireplaces, central air and humidification, central stereo, and an architecturally stunning curved staircase that connects the 2 floors. This white glove building provides full time doormen, attended elevators, a parking garage, swimming pool, basketball court, squash court and fitness center.",
