                "description": "Showings Begin Monday, March 12th    This stunning, turn-key, all new renovated duplex residence is located in the prestigious Cooperative at 4 East 70th Street, directly across from The Frick Collection. A gracious Entry with limestone floors leads to the intimate Dining Area with herringbone floors and an adjoining Kitchen designed by Christopher Peacock with custom cabinetry, Thassos marble counters and backsplash, Subzero refrigerator and Miele dishwasher. The elegant Living Room wrapped in all new windows features a decorative Fireplace and is ideal for entertaining. This floor also features a large Bedroom with a walk-in closet and en-suite Bathroom with Venetian Plaster walls. A timeless spindle staircase with custom wood paneled walls leads to the enchanting top floor. The stylish Master Bedroom Suite includes a grand windowed Dressing Room with 5 large closets and a marble spa Bathroom with Waterworks fixtures and built-in dressing table. Behind frosted glass pocket doors is a handsome Study with lacquered walls and wired for sound. Additional features include; oversized vented Whirlpool Washer/Dryer, 12 custom-built closets by Forte, Waterworks fixtures, exposed beams, and thru-the-wall A/C throughout. 2 separate storage bins included. This is a rare opportunity to own an exquisite home in New York on one of the quietest, most prestigious blocks off Fifth Avenue.  The residence was designed by famed designers Aman & Carson and built by Forte Remodeling; one of the top luxury contracting firms in Manhattan. Aman & Carson s recent accolades include: The covers of Architectural Digest and Elle D cor, and were chosen several times by House Beautiful as one of  America s Top 100 Designers in America.  Both Aman & Carson and Forte were intimately involved in every stage of this apartment s renovation; the attention to detail; the quality of the aesthetic and materials used reflect their talent and commitment to excellence. The current owner s care and upkeep of this magnificent home are a testament to its unique beauty.  This Art Deco building was constructed in 1938 with only 37 apartments and is a well-established Cooperative with full services and a resident manager. This unique property is located on one of the most desirable blocks in New York City, steps from Central Park, flagship boutiques, and fine dining. Pets are welcome upon approval. Pied-a-terre purchase permitted.",
