                "description": "The Columbia House      TCO has been obtained. Ready to move in immediately.    Walk out of your private key locked elevator into your PH oasis. Your Great room has a gas burning fireplace, flush mount 5 channel surround sound speakers and a 46  flat screen TV mounted on the wall.   A large open kitchen with breakfast bar has a 36  SubZero refrigerator, Viking stove & microwave, Bosch DW & W/D. The Penthouse duplex has 2 large South facing bedrooms with a large terrace accessible from both. The master bedroom has a walk in closet, 5 piece limestone custom bathroom  with double sinks, WC, true steam shower with a rain head & a Jacuzzi soaking tub.   A private curved oak staircase takes you up to your roof top oasis, 873 sq/ft. From your roof watch the boats go by in the Hudson. The roof top is decked with 18  square pavers, a retractable awning, outdoor speakers, lights and water it is all ready for you to relax and create a garden eden for yourself or invite 40 friends for a party.  The apartment has 2.5 baths and there is room for a home office with a window.  The Columbia House is a brand new building constructed to mesh with the historic upper west side neighborhood while pushing the envelope of what modern pre-war can be. True brick fa ade with a rear glass curtain wall overlooking the South facing private garden.   9+ft ceilings, 6' strip dark stained bamboo hardwood floors, true central heat and air with ceiling ducts, working gas fireplace in the living room, state of the art video intercom security and private key-locked elevator. This unit comes with a 67 sq/ft cedar lined seasonal storage in the basement at no additional cost and equipped with a phone jack for when you forget what you went looking for.  The complete offering terms are in an Offering Plan available from Sponsor.  CD07-0172    http://www.238w108.com",
