                "description": "Absolutely no expense was spared redesigning this phenomenal corner loft on a high floor at The Cass Gilbert Condominium.  Light pours through 2 exposures north and east. The views are open to midtown and the Empire State Building.  This grandly proportioned home includes a wide entrance gallery perfect for displaying artwork, large formal living/dining room that empties onto a planting terrace that spans the width of the loft, gourmet kitchen with all of the bells and whistles, master bedroom, windowed guest suite, windowed home office, and a separate media room customized with high-end electronics.  3 full baths, 3 massive walk-in closets customized to maximize storage, 3 additional closets, 11' beamed ceilings and washer/dryer complete the picture.  The Cass Gilbert Condominium was developed 3-4 years ago and was a quick sell-out.  The building employs a superintendant and a part time lobby attendant and gladly welcomes pets of all shapes and sizes. Rarely is a home of this caliber available. Hours for super M-F 7-4PM. Doorman M-f 11-8, Sat 10-2, Sun NONE.",
